(8, 1, '2018-09-06 05:49:05', '2018-09-06 05:49:05', '<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h1 class=\"text-center\">Welcome To The Dental Center</h1>\r\n<p class=\"text-justify\">You\'ve known us as Content Design Group since the beginning, 9 years ago. Since then we\'ve expanded and evolved and we thought it was time for our brand to reflect those changes. We\'re still the same old guys, who are passionate about great design, and making this city the best it can be! We couldn\'t have done any of it without our wonderful, talented friend Amber Aultman, who put up with us through the whole process and still likes us (we think).</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"container hitech\">\r\n<h1 class=\"text-center\"> Hi-Tech Laboratory</h1>\r\n<div class=\"row\">\r\n<div class=\"col-md-3\">\r\n<div class=\"brd p-2 home1\">\r\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/peter-kasprzyk-110926-unsplash.jpg\" class=\"w-100 img \">\r\n<p class=\"text-justify\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>\r\n<button>Read More</button>\r\n</div>\r\n</div>\r\n<div class=\"col-md-3\">\r\n<div class=\"brd p-2 home1\">\r\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/daniel-frank-201417-unsplash.jpg\" class=\"w-100 img \">\r\n<p class=\"text-justify\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>\r\n<button>Read More</button>\r\n</div>\r\n</div>\r\n<div class=\"col-md-3\">\r\n<div class=\"brd p-2 home1\">\r\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/stepan-vrany-421620-unsplash.jpg\" class=\"w-100 img \">\r\n<p class=\"text-justify\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>\r\n<button>Read More</button>\r\n</div>\r\n</