(33, 1, '2018-09-06 12:57:47', '2018-09-06 12:57:47', '<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<h1 class=\"text-center\">Welcome to the </h1>\n<p class=\"text-justify\">You\'ve known us as Content Design Group since the beginning, 9 years ago. Since then we\'ve expanded and evolved and we thought it was time for our brand to reflect those changes. We\'re still the same old guys, who are passionate about great design, and making this city the best it can be! We couldn\'t have done any of it without our wonderful, talented friend Amber Aultman, who put up with us through the whole process and still likes us (we think).</p>\n</div>\n</div>\n</div>\n<div class=\"container hitech\">\n<h1 class=\"text-center\"> Hi-Tech Laboratory</h1>\n<div class=\"row\">\n<div class=\"col-md-3\">\n<div class=\"brd p-2 home1\">\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/peter-kasprzyk-110926-unsplash.jpg\" class=\"w-100 img \">\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>\n<button>Read More</button>\n</div>\n</div>\n<div class=\"col-md-3\">\n<div class=\"brd p-2 home1\">\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/daniel-frank-201417-unsplash.jpg\" class=\"w-100 img \">\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>\n<button>Read More</button>\n</div>\n</div>\n<div class=\"col-md-3\">\n<div class=\"brd p-2 home1\">\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/stepan-vrany-421620-unsplash.jpg\" class=\"w-100 img \">\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>\n<button>Read More</button>\n</div>\n</div>\n<div class=\"col-md-3\">\n<div class=\"brd p-2 home1\">\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/michael-browning-40733-unsplash.jpg\" class=\"w-100 img\">\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>\n<button>Read More</button>\n</div>\n</div>\n\n</div>\n</div>\n<!---------------------------------------------Servies------------------------------------------------>\n<div class=\"container mt-5 mb-5\">\n<div class=\"row\">\n<div class=\"col-md-6\">\n<h1 class=\"text-center\">Laboratory1</h1>\n<p class=\"text-justify\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\n</div>\n<div class=\"col-md-6\">\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/daniel-frank-201417-unsplash.jpg\" class=\"w-100\">\n</div>\n</div>\n<div class=\"row mt-5 \">\n<div class=\"col-md-6\">\n<img src=\"http://localhost/dental1/wp-content/uploads/2018/09/michael-browning-40733-unsplash.jpg\" class=\"w-100\">\n</div>\n<div class=\"col-md-6\">\n<h1 class=\"text-center\">Laboratory2</h1>\n<p class=\"text-justify\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\n</div>\n\n</div>\n</div>', 'Home', '', 'inherit', 'closed', 'closed', '', '8-autosave-v1', '', '', '2018-09-06 12:57:47', '2018-09-06 12:57:47', '', 8, 'http://localhost/dental1/2018/09/06/8-autosave-v1/', 0, 'revision', '', 0),
