(94, 1, '2018-09-06 09:49:33', '2018-09-06 09:49:33', '<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h2 class=\"text-center\">About The Dentel Center</h2>\r\n<p class=\"text-justify\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n</div>\r\n\r\n</div>\r\n</div>\r\n<div class=\"container text-justify\">\r\n<h4>Health Care Advice Anytime. Anywhere.</h4>\r\nA.D.A.M.’s Ask A Doctor service gives quick and easy access to doctors, anytime, anywhere. At any time of day, more than 100 doctors are online and ready to answer your questions. Our global network is made up of more than 18,000 doctors from more than 50 specialties. For any health questions, our doctors are ready to help.\r\n\r\nAsk A Doctor transforms how people approach their health and wellness. Ask A Doctor is now the largest website where people can get answers from Doctors, around the world, around the clock.\r\n\r\n<h4>Ask A Doctor</h4>\r\nUsing our Ask A Doctor service, you can send your questions to a Doctor and the Doctor will reply within minutes. It’s as if you are having an email exchange with your very own private Physician!\r\n\r\nAs soon as you post your question, a qualified Doctor will start answering it. The Doctor will provide you with the all the medical information you need, and will guide you as you choose a course of action—all from the comfort of your home or office. No more sitting in the waiting room for hours just to get some basic information from your doctor; no more self-diagnosis after reading pages and pages of confusing and contradictory online information. Ask the Doctor gives you the personalized health information you need to decide on the right treatment for YOU.\r\n\r\n<h4>Ask A Specialist</h4>\r\nSometimes it seems almost impossible to get an appointment with a Cardiologist, Oncologist, Urologist, or any other highly qualified specialist. Even if you are able to meet with one, they’re so overbooked that you may not even get enough time to have all your questions and concerns addressed.\r\n\r\nWith Ask A Specialist, you can send your question to, and get a reply from, a Specialist in one of more than 50 fields of medicine, or even ask for a second opinion on a serious health matter.\r\n\r\nWhether you need a Neurologist, Hematologist, or Pediatrician, Ask A Specialist can help you.\r\n\r\n<h4>AskADoctor 24x7</h4>\r\nAskADoctor 24x7 is an online health service that brings to you a plenitude of health and medical content along with easy access to doctors, anytime, anywhere. The high quality and scientifically reviewed health blogs are curated in a way to help bring out a positive impact on your daily lifestyle. At the ease of a mouse click, you can also ask any health query from our pool of certified doctors 24x7. You can also avail e-consultation on our Ask A Doctor app\r\n\r\n<h4>Health Resources</h4>\r\nAsk A Doctor is integrated with our A.D.A.M. Consumer Health content. This unbiased, peer-reviewed content is written at a 6th to 8th grade reading level, providing a comprehensive health resource that is easy for everyone to understand. A.D.A.M. Consumer Health content includes:\r\n\r\nMedical Reference Library\r\nHealth Calculators\r\nHealth Risk Assessment\r\nIn-Depth Reports\r\nComplementary & Alternative Medicine\r\nLearning Modules\r\nAsk A Doctor Strategic Partnerships\r\nA.D.A.M.\'s Ask A Doctor offers four distinct strategic partner programs designed to meet the needs of our partners. Whether you\'re a major consumer portal or employer looking for partnership opportunities or a large academic institution seeking a trusted consultative medical resource, our partnership programs can help you achieve your business objectives.\r\n\r\n<h4>Ask A Doctor Revenue Sharing Partners</h4>\r\nAsk A Doctor Revenue Sharing Partners program is designed for major consumer portals and employers to offer a value-added service to their customers or employees by simply adding a link to Ask A Doctor on their websites without making a financial investment.\r\n\r\nPartners will also receive a quarterly utilization report on how much traffic and revenue was generated from their website/portal, and a 15% payment of all revenue generated.\r\n\r\nUsers will simply click on the Ask A Doctor link on partner\'s site, create user profiles and pay via credit card, ask their questions, and they are notified by email when a response has been provided by one of our network physicians.\r\n\r\n<h4>Ask A Doctor Global Network Portal Partners</h4>\r\nAsk A Doctor Global Network Portal Partners are employers or large academic institutions who provide access to Ask A Doctor\'s Health and Wellness Portal and Health Resources to their users at no cost to help reduce unnecessary utilization of procedures and services, improve member health and retention.\r\n\r\nThis value-added service includes a branded iOS and Android mobile app that allows users to ask questions and get answers from our global network of 18,000 physicians and specialists anywhere, anytime.\r\n\r\n<h4>Why become an Ask A Doctor global network partner? To…</h4>\r\n\r\nEmpower members to make more informed decisions\r\nProvide valued personalized medical advice, 24/7/365\r\nMinimize use of unnecessary OTC medications and costly services\r\nProvide access to members all over the world\r\nImprove member engagement, satisfaction, retention and reduce absenteeism\r\nEducate members with A.D.A.M.\'s award-winning content\r\n</div>\r\n', 'About us', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2018-09-06 09:49:33', '2018-09-06 09:49:33', '', 10, 'http://localhost/dental1/2018/09/06/10-revision-v1/', 0, 'revision', '', 0),
